import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';


const App = () => {
  return (
    <Router>
      <div>
        <Route path="/" exact component={HomePage} />
      </div>
    </Router>
  );
};

const HomePage = () => {
  return (
    <div>
      <Header />
      <HeroSection />
      <AboutSection />
      <ClassesSection />
      <ContactSection />
      {/* Add other components as needed */}
    </div>
  );
};



export default App;
